pragma solidity 0.8.7;

/**
 * EtherSplitter
 * Splits transferred Ether
 */

contract EtherSplitter {
    address payable user1;
    address payable user2;

    constructor(address payable _user1, address payable _user2) {
        user1 = _user1;
        user2 = _user2;
    }

    modifier ethNeeded {
        require(msg.value > 0, "You must provide ETH to be split between addresses");
        _;
    }

    function pay(address payable addr, uint sum) private returns (bool ok) {
        return addr.send(sum);
    }

    function eth_split() payable public ethNeeded {
        uint eth = msg.value;
        uint payable_eth = eth / 2;
        bool check;

        check = pay(user1, payable_eth);
        check = pay(user2, payable_eth);
    }
}

